import styled from "styled-components";

const MyPageGNB = styled.h1`
  display: flex;
  align-items: center;
  font-size: 5rem;
  font-weight: 600;
  background-color: purple;
  width: 100vw;
  height: 10rem;
  padding: 2rem;
  position: fixed;
  box-sizing: border-box;
  top: 12.5rem;
  margin: 1px;
`;
const UpdateForm = styled.form`
  display: flex;
  width: 90%;
  height: var(--mobile-screen);
`;

function MyPage() {
  return (
    <div id="GlobalContainer">
      <MyPageGNB>마이 페이지</MyPageGNB>
    </div>
  );
}

export default MyPage;
